import { useState } from 'react';
import { Paper, TextField,Grid } from '@material-ui/core';

import useStyles from './styles';
import TimeMenu from '../TimeMenu/TimeMenu';

export default function SubmitForm() {
    const classes = useStyles();

    return (
        <Paper className={{ margin:10}}>
            <Grid containter direction="row" justify="center" alignItems="center">
                <Grid >
                    <TextField variant="outlined" label="Title" />
                </Grid>
                <Grid >
                    <TextField variant="outlined" label="Description" />
                </Grid>
                <Grid >
                    <TimeMenu name="Start Time"/>
                    <TimeMenu name="End Time"/> 
                </Grid>
                <Grid >
                    <TextField variant="outlined" label="Title" />
                </Grid>
            </Grid>

        </Paper>
    );
}
